INSERT INTO shelter VALUES(1,'shelter_photos/행복이네.jpg','제주도의 유기동물 보호소입니다. 사랑과 보살핌이 넘치는 곳입니다.','010-1234-5678','행복이네 보호소');
INSERT INTO dog VALUES('dog_photos/1.jpg',1,'쿠퍼',3,'수컷','셰틀랜드 쉽독,중형,활발함,친화적',20,'제주 바닷가에서 구조되었어요. 심장사상충 감염으로 치료 후 건강을 회복했어요. 뛰어노는 것을 좋아해요. 고구마를 좋아해요. ''앉아''라는 개인기가 있어요.','202400000001','김민수',1);
INSERT INTO dog VALUES('dog_photos/2.jpg',2,'짱이',2,'수컷','진돗개,중형,온순함,관절염,귀여움',10,'산책 중 발견 후 구조되었어요. 관절염이 있어서 심하게 뛰는 활동은 피해주세요. 당근을 좋아해요. ''엎드려''라는 개인기가 있어요.','202400000002','정우성',1);
INSERT INTO dog VALUES('dog_photos/3.jpg',3,'코코',1,'암컷','페터데일 테리어,소형,사랑스러움,온순함',15,'시골길에서 발견 후 구조되었어요. 피부병을 앓고 있었지만 치료 중이에요. 사과를 좋아해요. ''손''이라는 개인기가 있어요.','202400000003','박소연',1);
INSERT INTO dog VALUES('dog_photos/4.jpg',4,'바둑이',4,'수컷','풍산개,대형,호기심 많음,건강 상태 주의 필요',30,'농장에서 구조되었어요. 눈병이 있어 정기적인 관리가 필요합니다. 호박을 좋아해요. ''짖어''라는 개인기가 있어요.','202400000004','이준호',1);
INSERT INTO dog VALUES('dog_photos/5.jpg',5,'하리',5,'암컷','믹스견,중형,온순함,청각장애',25,'산책 도중 발견되었어요. 청각장애가 있지만 활동적인 생활을 즐기며 호기심이 많습니다. ''굴러''라는 개인기가 있어요. 하리는 인식 칩이 없었고 주인을 기다리고 있어요.','','',1);
INSERT INTO dog VALUES('dog_photos/6.jpg',6,'지우',1,'암컷','래브라도 리트리버,소형,활발함,사람 친화적',12,'어린 나이에 구조되었어요. 사람을 좋아하고 블루베리를 좋아해요. ''기다려''라는 개인기가 있어요.','202400000006','장미희',1);
INSERT INTO dog VALUES('dog_photos/7.jpg',7,'모찌',2,'암컷','닥스훈트,소형,활발함,애교 많음',8,'길가에서 발견되었어요. 활발하고 사람을 잘 따릅니다. 고구마를 좋아하고 ''방석 위에 앉기''라는 개인기가 있어요.','202400000007','오세진',1);
INSERT INTO dog VALUES('dog_photos/8.jpg',8,'태양',6,'수컷','시바견,중형,독립적,온순함',18,'독립적인 성격으로 산책 중 발견되었어요. 당근을 좋아하며, ''옆에 서기''라는 개인기가 있어요.','202400000008','김태우',1);
INSERT INTO dog VALUES('dog_photos/10.jpg',9,'아리',4,'암컷','비숑 프리제,소형,활발함,친화적',22,'도심 공원에서 구조되었어요. 온순하고 사람을 잘 따릅니다. 당근을 좋아하며 ''손''이라는 개인기가 있어요.','202400000010','이정현',1);
